import React from 'react';
import './App.css';
import ToDoList from './components/ToDoList';
import Header from './components/Header';
import Footer from './components/Footer';
function App() {
  return (
    <div className="App">
      <section>
      <Header />
      <ToDoList />
      <Footer />
      </section>
    </div>
  );
}

export default App;
